import React, { Component } from 'react';
import Head from '../components/Head';
import Form from '../components/Form';

export default class Login extends Component {
	constructor(props) {
		super(props);
		console.log(this.props);
	}
	render() {
		return (
			<div>
				<Head />
				<Form 	props={this.props}/>
			</div>
		);
	}
}
